function main(hasSelection, actName){
    var countVar = doc.layerSets.length - 2;
    var hasRun = false, bgLyr=null, alp1= null, varCurrent = null; 
    for(var i=0; i <countVar; i++){
        var grVar = doc.layerSets.getByName("Variant "+ (i+1));
        var grItem = grVar.layerSets.getByName("Item "+(i+1));
        var grBg = grVar.layerSets.getByName("Background "+(i+1));
        //find layer product
        var product = null;
        for(var j=0; j<grItem.artLayers.length; j++){
            if(grItem.artLayers[j].name.toLowerCase().search("product") != (-1) ){
                product = grItem.artLayers[j];
            }
            if(grItem.artLayers[j].name.search("Retouch BG") != (-1)){
                grItem.artLayers[j].remove();
                j--;
            }
        }
        //-------
        if (!hasSelection && !hasRun) {
            if(hasMask(product)){
                loadSelection(product);
                selectRGB(product);
                //Save selection to alpha channel
               try{ doc.channels.getByName("pro-sec").remove();}catch(err){}
                alp1 = saveAlphaChnl("pro-sec");
                doc.selection.deselect();
                //bgLyr.duplicate(grBg, ElementPlacement.INSIDE).name = "Retouch BG";
            }
            else if (hasVectorMask (product)) {
                if (alp1 == null) {
                    loadSelectionVectorMask (product);
                    try{ doc.channels.getByName("pro-sec").remove();}catch(err){}
                    alp1 = saveAlphaChnl("pro-sec");
                    doc.selection.deselect(); 
                }
                //bgLyr.duplicate(grItem, ElementPlacement.INSIDE).name = "Retouch BG"; 
            }
            else {
                //continue;
            }
        }else if  (alp1 == null){
              try{ doc.channels.getByName("pro-sec").remove();}catch(err){}
              alp1 = saveAlphaChnl("pro-sec");
              doc.selection.deselect();
         }
     // ******************************************
        if(hasRun){
            if (varCurrent != null && varCurrent == product.parent ) {
                desaturationMask();
                break;
            } 
            desaturationMask (grVar,alp1);
            /*if(hasMask(product)){
                loadSelection(product);
                bgLyr.duplicate(grBg, ElementPlacement.INSIDE).name = "Retouch BG";
            }
            else (hasVectorMask (product)) {
                bgLyr.duplicate(grItem, ElementPlacement.INSIDE).name = "Retouch BG"; 
            }*/
        }     
        // hasRun == false 
        if (countVar>1 && i == countVar - 1 && alp1 != null && !hasRun && !hasSelection) {
            doc.selection.load(alp1);
            main(true, actName);
            break; 
        }
        if(grBg.allLocked || grVar.allLocked || hasRun || alp1 == null  ){continue;}    
        //-------------
        bgLyr = product.duplicate();
        bgLyr.name = "bg-cache";
        bgLyr.allLocked = false;
        bgLyr.transparentPixelsLocked = false;
        deleteVectorMask(bgLyr);
        bgLyr = new LayerExtend(bgLyr);
        // bat dau chay
        if(hasMask(product)){
            doc.activeLayer = bgLyr;
            bgLyr.move(grBg, ElementPlacement.INSIDE);
            bgLyr.mask.remove();
            process1();
            //alert (bgLyr.parent);
            fillHistory();
        }
        else{
            doc.activeLayer = bgLyr;
            bgLyr.move(doc.layerSets.getByname("Resources"), ElementPlacement.INSIDE);
            process1();
            //doc.selection.load(alp1);
            bgLyr.mask.add();
            bgLyr.invert();
            selectRGB(bgLyr);
        }
        doc.selection.deselect();
        doc.selection.load(alp1);
        doc.selection.invert();
        try{doc.layerSets.getByName("Resources").artLayers.getByName("Darken Check").visible = true;}catch(err){}
        function process1(){
            bgLyr.name = "Retouch BG";
            setHistoryBrush () 
            app.doAction(actName, "BR-Act-Cache");
            //deleteActionSet("BR-Act-Cache");
            //-------------- add mask layer Desaturation
            desaturationMask (grVar,alp1);
            doc.activeLayer = bgLyr;
            //-----
            doc.selection.load(alp1);
            doc.selection.expand (5);
            doc.selection.feather(2);  
            varCurrent = product.parent;
            hasRun = true;   
        }
    }
}
