function checkActionPalette(){
    var count = 1, actionActive="NotRun", nextRun = true, logText="";
    var logNameAct = new File("~/Appdata/Roaming/Adobe/logAct.log");
    if(logNameAct.exists){
        logNameAct.open("r");
        logText = logNameAct.read();
        logNameAct.close();
    }
    try{
        while(nextRun){
            var ref = new ActionReference();
            ref.putIndex(charIDToTypeID("ASet"), count);
            var desc = executeActionGet(ref);
            if(desc.getString(charIDToTypeID("Nm  ")) == "BR-Act-Cache"){
                nextRun = false, selectItem=logText, existName=false;
                var totalAct = desc.getInteger(charIDToTypeID("NmbC"));
                var box = new Window("dialog{text:'BR-Act', properties:{closeButton: true}}");
                var grList = box.add("panel{text:'***',orientation: 'column', alignChildren: 'left'}");
                for(var i=1; i<= totalAct; i++){
                    var refAct = new ActionReference();
                    refAct.putIndex(charIDToTypeID("Actn"), i);
                    refAct.putIndex(charIDToTypeID("ASet"), count);
                    var desc1 = executeActionGet(refAct);
                    // show UI panel         
                    var checkbox = grList.add("radiobutton{text: '"+desc1.getString(charIDToTypeID("Nm  "))+"', value:false}");
                    if(logText == desc1.getString(charIDToTypeID("Nm  ")) ){ checkbox.value = true; existName = true;}
                    checkbox.onClick = function(){
                        selectItem = this.text;
                        existName = true;
                    }
                }
                // group BTN
                var grBtn = box.add("group");
                var btnCancel = grBtn.add("button{text:'Cancel', size:[70,20], properties: {name:'cancel'}}");
                var btnOk = grBtn.add("button{text:'OK', size:[70,20], properties: {name:'ok'}}");
                btnOk.onClick = function(){
                    actionActive = (existName)? selectItem : "";
                    logNameAct.open("w");
                    logNameAct.write(actionActive);
                    logNameAct.close();
                    box.close();
                }
                box.show();
            }
            count++;
        }
    }catch(err){try{app.open(fileAct);}catch(err){actionActive = "RT BG";}}
    return (actionActive==null)? "RT BG" : actionActive;
}
