function checkPath () {
    var workPath = null;
    if (doc.pathItems.length>0) {
        try {
            workPath = doc.pathItems.getByName("Work Path");
            var pathPoints = workPath.subPathItems[0].pathPoints;
            if(pathPoints.length<=5) {
                var anchor0 = pathPoints[0].anchor;
                var anchor1 = pathPoints[pathPoints.length-1].anchor;
                var widthPath = anchor1[0] - anchor0[0];
                if(widthPath < doc.width){
                    throw workPath = null;
                };
            }
        else {
            workPath = null;
            }
        } 
        catch (err){}
    }
    return workPath;
}
function loadWorkPath (pathItem) {
    if(pathItem == null) {
        //alert ("k co path");
        return; 
    }
    var pathPoints = pathItem.subPathItems[0].pathPoints;
    var pos1 = pathPoints[0].anchor;
    var pos2 = pathPoints[pathPoints.length-1].anchor; 
    var postemp = pos2;
    var direction = "top";
    if(pathPoints.length ==2) {
        postemp[1] = pos2[1] - 5;
    } 
    else {
        for (var i = 1; i < pathPoints.length; i++) {
           if(pathPoints[i].anchor[0] >=  doc.width ) {
                pos2 = pathPoints[i].anchor;
                break;
           }
        }
    }   
    if (pos2[1] < postemp[1]) {
        var pos3 = [doc.width , doc.height];
        var pos4 = [0 , doc.height];
        direction = "bottom";
    } else {
        var pos3 = pos2;
        var pos4 = pos1;
        var pos1 = [0,0];
        var pos2 = [doc.width, 0];
        
     }
    doc.selection.select([pos1, pos2, pos3, pos4], SelectionType.REPLACE, 0,  true);
    //***********************process wall line***************************
    var bg = doc.activeLayer; 
    var bgCopy = new  LayerExtend(doc.activeLayer.duplicate());
    if(bgCopy.mask.status){bgCopy.mask.apply();}
    bgCopy.mask.add().apply();
    bgCopy.move(bg,ElementPlacement.PLACEAFTER);
    doc.selection.deselect();
    // strokePath:
    settingBrush();
    var lyrTemp = doc.activeLayer.parent.artLayers.add();
    pathItem.strokePath(ToolType.BRUSH,false);
    loadSelectionRGB(lyrTemp);
    lyrTemp.remove(); 
    pathItem.deselect(); 
    //  pathItem.remove();
    doc.selection.clear();
    if (direction == "top") {
        bg.translate (0,- 12);
    } else {
        bg.translate (0,12);
    } 
     //bg.merge();
    //bgCopy.name = "Retouch BG";
    doc.selection.deselect();
} 
